-- Function to give Candys
local function giveCandys(amount)
    print("You have received " .. amount .. " Candys!")
    -- Ensure 'data' is defined correctly
    local player = game.Players.LocalPlayer
    local data = player.Data
    if data and data.Candy then
        data.Candy.Value = amount
    else
        print("Data or Candy not found!")
    end
end

-- Button to get Candys
AddButton(Main, {
  Name = "Get Candys",
  Callback = function()
      if candy and candy ~= "" then
          giveCandys(tonumber(candy)) -- Convert to number before passing
      else
          print("Please enter a valid number.")
      end
  end
})
